import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The view toggle buttons appear after a search. Let's perform a search.
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.locator('#searchInput').fill('electronics');
    await page.locator('button.search-btn').first().click();

    // Wait for the search results and view toggle buttons to appear
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Find and click the List View button
    const listViewButton = page.locator('button[title="List View"]');
    await listViewButton.waitFor({ state: 'visible', timeout: 5000 });
    await listViewButton.click();

    // Take a screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view_mode.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view_mode.png'));

    // Verify the switch by checking the class of the button
    const buttonClass = await listViewButton.getAttribute('class');
    if (!buttonClass || !buttonClass.includes('active')) {
      throw new Error('List view button did not become active after clicking.');
    }

    return {
      success: true,
      action: "Switched to List View Mode by clicking the list view button.",
      extractedData: {
        listViewButtonClass: buttonClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Capture a screenshot on failure
    const errorScreenshotPath = path.join(screenshotsDir, 'error.png');
    await page.screenshot({ path: errorScreenshotPath });

    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
